import React, { Component } from 'react';
import { Tabs, Tab, Button} from 'react-mdl';
import Posti from './images/Posti.jpg';
import HackathonGOC from './images/HackathonGOC.jpg';
import CodeWeek from './images/CodeWeek.jpg';
import Adidas from './images/Adidas.jpg';
import BetsFriends from './images/BetsFriends.jpg';
import Vredestein from './images/Vredestein.jpg';
import PCdesign from './images/PC-Design.jpg';
import PCtechnical from './images/PC-Technical.jpg';
import { Layout, Navigation, Content } from 'react-mdl';
import { Link } from 'react-router-dom';
import { FullPage, Slide } from 'react-full-page';

export default function Projects() {
  const controlsProps = {
    style: {
      left: '50%',
      paddingTop: '10px',
      position: 'fixed',
      transform: 'translateX(-50%)',
    },
  };
  return (
    <FullPage controls>
      <Slide
        style={{
          background: '#2ECC40', display: 'flex', alignItems: 'center', justifyContent: 'center',
        }}
      >
        <h1>1</h1>
      </Slide>
      <Slide
        style={{
          background: '#0074D9', display: 'flex', alignItems: 'center', justifyContent: 'center',
        }}
      >
        <h1>2</h1>
      </Slide>
      <Slide
        style={{
          background: '#00c4ff', display: 'flex', alignItems: 'center', justifyContent: 'center',
        }}
      >
        <h1>3</h1>
      </Slide>
      <Slide
        style={{
          background: '#d52685', display: 'flex', alignItems: 'center', justifyContent: 'center',
        }}
      >
        <h1>4</h1>
      </Slide>
    </FullPage>
  );
}

